const login = require("fca-horizon-remastered");

const tokenList = [
    "TOKEN_1",
    "TOKEN_2",
    "TOKEN_3"
];
let currentTokenIndex = 0;

const forbiddenWords = ["lừa đảo", "hack", "bán acc"];

let messageCount = 0;
setInterval(() => messageCount = 0, 60000);

const checkMessage = (message) => !forbiddenWords.some(word => message.includes(word));

const sendMessageWithDelay = async (api, threadID, message, delay) => {
    if (!checkMessage(message)) return;
    if (messageCount >= 5) return;

    await new Promise(resolve => setTimeout(resolve, delay));
    api.sendMessage(message, threadID);
    messageCount++;
};

const autoSwitchToken = () => {
    currentTokenIndex = (currentTokenIndex + 1) % tokenList.length;
    login({ appState: tokenList[currentTokenIndex] }, handleLogin);
};

const handleLogin = (err, api) => {
    if (err) {
        autoSwitchToken();
        return;
    }

    api.listenMqtt((err, event) => {
        if (err) return;
        if (event.type === "message" && event.body) {
            sendMessageWithDelay(api, event.threadID, "Bot đã nhận tin nhắn!", 3000);
        }
    });
};

login({ appState: tokenList[currentTokenIndex] }, handleLogin);

